import React, { Component } from 'react';
import MyInput from './MyInput'
import '../style/Cadastro.css'

class Cadastro extends Component {
    constructor(props) {
        super(props);

        this.state = {
            login: '',
            senha: ''
        }
        this.entrar = this.entrar.bind(this);
    }

    render () {
        return (
            /*onChange={event => onChange(changeValue('Nome', event.target.value))}*/
            <div className="Cadastro-card">
                <span className="Title">Cadastrar-se</span>
                <MyInput label={'Nome'} onChange={(event) => { this.setState({login:event.target.value}) }} value={this.state.login}/>
                <MyInput label={'Usuário'}/>
                <MyInput label={'Senha'}/>
                <MyInput label={'Confirmar Senha'}/>
                <button className="Botao-entrar">Cadastrar</button>
                <div className="Voltar-area"><span onClick={this.props.onVoltar} className="Voltar">Voltar</span></div>
            </div>
        )
    }
}

export default Cadastro;
